import React from "react";
import Photo from "./Photo";

const Slider = (props) => {
  return (
    <>
      <div className='flex-container'>
        <Photo
          width={props.width}
          height={props.height}
          src={props.photoLeft}
        />
        <Photo
          width={props.width}
          height={props.height}
          alt={props.altText}
          photographer={props.photographer}
          src={props.src}
          id={props.id}
        />
        <Photo
          width={props.width}
          height={props.height}
          src={props.photoRight}
        />
      </div>
      {/* <div className='flex-column-container'> */}
      <h2 className='photographer-name'>{`Photographer: ${props.photographer}`}</h2>
      {/* </div> */}
    </>
  );
};

export default Slider;
